package com;

public class SysQu {
	String qu_id;
	String qu_name;
	int toupiao_id;
	int pinyi_id;
	
	public SysQu() {
		// TODO Auto-generated constructor stub
	}

	public String getQu_id() {
		return qu_id;
	}

	public void setQu_id(String qu_id) {
		this.qu_id = qu_id;
	}

	public String getQu_name() {
		return qu_name;
	}

	public void setQu_name(String qu_name) {
		this.qu_name = qu_name;
	}

	public int getToupiao_id() {
		return toupiao_id;
	}

	public void setToupiao_id(int toupiao_id) {
		this.toupiao_id = toupiao_id;
	}

	public int getPinyi_id() {
		return pinyi_id;
	}

	public void setPinyi_id(int pinyi_id) {
		this.pinyi_id = pinyi_id;
	}

	
	
}
